script: |
  super -f text -I q999.spq | sort > q999.out

inputs:
  - name: q999.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT - 68 IN ( + 33, - col1 + - - col0 * - ( - + col2 ), + 38 );
  - name: tab1

outputs:
  - name: q999.out
    data: |
      51	14	96
      85	5	59
      91	47	68
